    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>loading...</title>
    <link rel="icon" href="abo.png">
    <style>
        * {
            margin: 0px;
            padding: 0px;
        }

        body{
            width: 100vw !important;
            height: auto !important;
            background: url(https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrij-VVzH0x3A12wU-oc_43Xgnzxi40bWTsw&usqp=CAU);
            background-size: 180px;
        }

#logo{
    width: 35%;
    background-size: cover;
    margin: auto;
    height: auto;
    border-radius: 10px;
    margin-top: 10px;
}
div { margin: 20px; }
.loading { 
  font-size: 2.2em; 
  font-family: monospace; 
}

.row{
    border-radius: 50px;
    width: 50% !important;
    margin: auto;
    margin-top: 50px;
    top: 10px;
    text-align: center;
    background-color: rgba(199, 199, 199, 0.781);
}   


@media (max-width: 767px){

    #logo{
        width: 70% !important;
    }
.row{
    width: 80% !important;
    margin-bottom: 30px;
    margin-top: 100px;
}
}
#carSVG {
    width: 220px;
    height: 220px;
    margin: auto !important;
  animation: spinner 2500ms infinite linear;
  -webkit-animation: spinner 2500ms infinite linear;
  -moz-animation: spinner 2500ms infinite linear;
  -o-animation: spinner 2500ms infinite linear;
}

.smoke {
  opacity: 0;
  animation: fade 2s infinite;
}

@keyframes spinner {
    from {
        transform:rotate(0deg);
        -webkit-transform:rotate(0deg);
        -moz-transform:rotate(0deg);
        -o-transform: rotate(0deg);
    }
    to {
        transform:rotate(360deg);
        -webkit-transform:rotate(360deg);
        -moz-transform:rotate(360deg);
        -o-transform:rotate(360deg);
    }
}

@keyframes fade {
    0%,
    100% {
        opacity: 0
    }
    50% {
        opacity: 1
    }
}

    </style>
